basics/.body:
Basics
Make sure you've completed the setup instructions to install dependencies and get the development server running.
Now that we have set up our development environment, let's get started by creating a simple web page with an  OpenLayers map, and understand the code.
In OpenLayers, a map is a collection of layers that get rendered to a web page.  To create a map, you need some markup (HTML) that creates the map viewport (e.g. a  element), a bit of style to give the map viewport the appropriate dimensions on your page, and map initialization code.
OpenLayers supports different kinds of layers:

Tile layers for tiled raster tile sets
Image layers for static images or images that are provided on demand for the map's extent
Vector layers for vector data from static files or for the map's current extent
Vector tile layers for tiled vector tile sets

In addition to the layers and the view, a map can be configured with a set of controls (i.e. UI elements on top of the map) and interactions (i.e. components that react to touch or pointer gestures on the map).
The markup
There should be an existing index.html file at the root of the workshop directory. Let's replace it with the following code:




    OpenLayers

      @import "node_modules/ol/ol.css";


      html, body, #map-container {
        margin: 0;
        height: 100%;
        width: 100%;
        font-family: sans-serif;
      }








The markup includes a  with an id of map-container that serves as the target container for the map.  The  makes the map container fill the whole page.
The application
To work with OpenLayers, we install the ol package from npm. This was already done in the previous npm install step.  If you were starting from scratch on a new application, you would run npm install ol in the terminal.
As entry point of the application, we create a main.js file, and also save it in the root of the workshop directory:
import OSM from 'ol/source/OSM';
import TileLayer from 'ol/layer/Tile';
import {Map, View} from 'ol';
import {fromLonLat} from 'ol/proj';

new Map({
  target: 'map-container',
  layers: [
    new TileLayer({
      source: new OSM(),
    }),
  ],
  view: new View({
    center: fromLonLat([0, 0]),
    zoom: 2,
  }),
});

The imports at the top bring in the required modules from the ol package.  With everything we need imported, we create a Map. The target points to the container  we have in our markup. We configure the map with a tiled image layer (TileLayer) and an XYZSource. Finally, the View defines the initial zoom, and the center of the map in the view projection. To provide geographic coordinates, we use the fromLonLat helper function from the ol/proj module.
Viewing the map
Now our application is ready for testing. Let's open the working map in a web browser: http://localhost:5173/. This is how it should look:
A map of the world
Further reading
In the final chapter of the workshop, we will learn how create a production build of the application for deployment.
As a starting point for your own applications, we recommend looking at the examples.
The API documentation provides reference to all classes and functions of OpenLayers.

basics/map.html.body:
Criando um mapa
No OpenLayers, uma mapa é uma coleção de camadas e várias interações e controles para interagir com o usuário. Um mapa é gerado a partir de três ingredientes básicos: marcação, declarações de estilo e código de inicialização.
Exemplo completo
Vejamos um exemplo completo de um mapa OpenLayers.





      #map {
        height: 256px;
        width: 512px;
      }

    OpenLayers example



    My Map


      var map = new ol.Map({
        target: 'map',
        layers: [
          new ol.layer.Tile({
            title: 'Global Imagery',
            source: new ol.source.TileWMS({
              url: 'https://ahocevar.com/geoserver/wms',
              params: {LAYERS: 'nasa:bluemarble', TILED: true}
            })
          })
        ],
        view: new ol.View({
          projection: 'EPSG:4326',
          center: [0, 0],
          zoom: 0,
          maxResolution: 0.703125
        })
      });




Tarefas

Certifique-se de ter completado a preparação do ambiente para instalar as dependências e ter o servidor de depuração rodando. 

Copie o texto acima em um arquivo chamado map.html e salve-o no diretório raiz do workshop.

Abra o arquivo em seu navegador: http://localhost:5173/map.html


Um mapa completo exibindo uma imagem do mundo
Tendo criado nosso primeiro mapa com sucesso, examinaremos o exemplo de forma mais detalhada.

basics/dissect.html.body:
Dissecando o seu mapa
Como demonstrado na seção anterior, um mapa é gerado a partir da junção da marcação, declarações de estilo e código de inicialização. Olharemos cada uma dessas partes com um pouco mais detalhe.
Marcação HTML para o mapa
A marcação para o mapa no exemplo anterior criou um elemento DOM único:


Este elemento  servirá como contêiner para visualização de nosso mapa. Aqui usamos um elemento , mas o contêiner pode ser qualquer elemento do tipo "block".
Neste caso, fornecemos um id para o elemento, dessa forma, podemos referênciá-lo como target de nosso mapa.
Estilo do mapa
O OpenLayers vem com uma folha de estilo padrão que especifica como os elementos relacionados ao mapa devem ser exibidos. Nós temos que incluí-la na página map.html ().
O OpenLayers não atribui nenhum tamanho padrão para o seu mapa. Assim, seguindo a folha de estilo default, nós precisamos incluir, no mínimo, uma declaração para informar o tamanho que o mapa ocupará na página.


    #map {
      height: 256px;
      width: 512px;
    }


Neste caso, nós estamos usando o id da div definida anteriormente como seletor e especificando a largura (512px) e a altura (256px) do mapa.
Estas declarações de estilo estão incluídas diretamente no  de nosso documento. Na maioria dos casos, as declarações de estilo relacionadas ao seu mapa ficarão em um arquivo CSS externo.
Inicialização do Mapa
O próximo passo para gerar o seu mapa é incluir algum código para inicializá-lo. No nosso caso, incluímos o elemento  na parte inferior do elemento  do documento.

    var map = new ol.Map({
      target: 'map',
      layers: [
        new ol.layer.Tile({
          source: new ol.source.TileWMS({
            url: 'https://ahocevar.com/geoserver/wms',
            params: {LAYERS: 'nasa:bluemarble', TILED: true}
          })
        })
      ],
      view: new ol.View({
        projection: 'EPSG:4326',
        center: [0, 0],
        zoom: 0,
        maxResolution: 0.703125
      })
    });


A ordem desses passos é importante. Antes do nosso script ser executado, o OpenLayers deve ser carregado. No nosso exemplo, o OpenLayers é carregado no  do documento com o elemento .
De forma semelhante, a inicialização do nosso mapa no código acima, não pode ser executada até que o elemento que servirá como contêiner, neste caso o , estar pronto. Incluindo o código na parte inferior do elemento , nós garantimos que o código da biblioteca está carregado e que o contêiner está pronto para receber nosso mapa.
Vamos olhar com mais detalhe o que o código de inicialização do mapa está fazendo. Nosso script cria um novo objeto ol.Map com algumas opções de configuração:
  target: 'map'

Nós usamos o id do contêiner para informar ao construtor do objeto onde o mapa deve ser renderizado. Neste caso, passamos a string "map" como target para o construtor do mapa. Esta sintaxe é um atalho para conveniência. Nós poderíamos ser mais explícitos e fornecer uma referência direta para o elemento (ex. document.getElementById("map")).
O trecho layers configura uma camada que será exibida em nosso mapa:
  layers: [
    new ol.layer.Tile({
      source: new ol.source.TileWMS({
        url: 'https://ahocevar.com/geoserver/wms',
        params: {LAYERS: 'nasa:bluemarble', TILED: true}
      })
    })
  ],

Não se preocupe com a sintaxe aqui se ela for nova pra você. A criação de camadas será vista em outro módulo. A parte importante é entender que a visualização de nosso mapa é uma coleção de camadas. Para ver um mapa, nós precisamos incluir pelo menos uma camada.
O passo final é a definição da view. Nós especificamos uma projeção (projection), um centro (center) e um nível de zoom (zoom). Nós também fornecemos uma resolução máxima (maxResolution) para garantir que não faremos requisições de bounding boxes que o GeoWebCache não possa antender.
  view: new ol.View({
     projection: 'EPSG:4326',
     center: [0, 0],
     zoom: 0,
     maxResolution: 0.703125
  })

Você acaba de dissecar com sucesso o seu primeiro mapa! Em seguida, aprenderemos mais sobre o desenvolvimento com o OpenLayers.

layers/wms.html.body:
Camadas WMS (Web Map Service)
Quando você adiciona uma camada ao seu mapa, a fonte de dados da camada é, geralmente, responsável por obter os dados a serem exibidos. O dado requisitado pode ser do tipo raster ou vetorial. Você pode pensar no raster como uma informação renderizada pelo servidor em formato de imagem. Por outro lado, um dado vetorial é entregue pelo servidor como uma informação estruturada e pode ser renderizada pelo cliente (seu navegador).
Existem diferentes serviços que fornecem dados do tipo raster. Esta seção apresenta os provedores que estão em conformidade com a especificação OGC (Open Geospatial Consortium, Inc.) Web Map Service (WMS).
Criando uma camada
Iniciaremos com um exemplo completo e modificaremos as camadas para uma melhor compreensão de como elas funcionam.
Vamos examinar o seguinte código:





      #map {
        height: 256px;
        width: 512px;
      }


    OpenLayers example


    My Map


      var map = new ol.Map({
        target: 'map',
        layers: [
          new ol.layer.Tile({
            title: 'Global Imagery',
            source: new ol.source.TileWMS({
              url: 'https://ahocevar.com/geoserver/wms',
              params: {LAYERS: 'nasa:bluemarble', TILED: true}
            })
          })
        ],
        view: new ol.View({
          projection: 'EPSG:4326',
          center: [0, 0],
          zoom: 0,
          maxResolution: 0.703125
        })
      });




Tarefas

Se você ainda não tiver feito, salve o texto acima como map.html no diretório raiz do workshop.

Abra a página no seu navegador para confirmar que está funcionando: http://localhost:5173/map.html


O construtor da classe ol.layer.Tile
O construtor da classe ol.layer.Tile aceita como parâmetro um objeto literal do tipo ol.layer.TileOptions veja: http://openlayers.org/en/latest/apidoc/ol.layer.Tile.html.
Neste caso, nós estamos passando a chave source por meio do objeto ol.source.TileWMS.
A camada pode receber um título humanamente legível por meio da chave title, mas qualquer nome arbitrário para a chave pode ser fornecido aqui.
No OpenLayers existe uma separação entre as camadas (layers) e as fontes de dados (sources), apesar de no OpenLayers 2 tudo fazer parte da camada.
ol.layer.Tile representa uma grade regular de imagens, ol.layer.Image representa uma única imagem. Dependendo do tipo de camada, você pode usar uma fonte de dados diferente (ol.source.TileWMS versus ol.source.ImageWMS).
O construtor da classe ol.source.TileWMS
O construtor da classe ol.source.TileWMS tem um único argumento (ver: http://openlayers.org/en/latest/apidoc/ol.source.TileWMS.html).
url é o endereço do provedor WMS e params é um objeto literal com os nomes dos parâmetros e seus respectivos valores. Somente o parâmetro LAYERS é requerido. Neste exemplo, adicionamos TILED: true, uma extensão específica do Geoserver para melhorar o cache dos blocos (tiles) gerados pelas camadas WMS.
  layers: [
    new ol.layer.Tile({
      title: 'Global Imagery',
      source: new ol.source.TileWMS({
        url: 'https://ahocevar.com/geoserver/wms',
        params: {LAYERS: 'nasa:bluemarble', TILED: true}
      })
    })
  ]

Tarefas

Este mesmo servidor WMS fornece uma camada Natural Earth chamada 'ne:NE1_HR_LC_SR_W_DR'. Mude o valor do parâmetro LAYERS de 'nasa:bluemarble' para 'ne:NE1_HR_LC_SR_W_DR'.
Seu construtor da classe ol.layer.Tile deve ficar assim: 
 new ol.layer.Tile({
   title: 'Global Imagery',
   source: new ol.source.TileWMS({
     url: 'https://ahocevar.com/geoserver/wms',
     params: {LAYERS: 'ne:NE1_HR_LC_SR_W_DR', TILED: true}
   })
 })


Mude sua camada e fonte de dados para ter uma imagem única ao ínves dos tiles. Olhe a documentação da API para algumas dicas: http://openlayers.org/en/latest/apidoc/ol.layer.Image.html e http://openlayers.org/en/latest/apidoc/ol.source.ImageWMS.html. Use a aba Network da ferramenta para desenvolvedores do seu navegador para checar se somente uma única imagem está sendo retornada ao invés de blocos de 256x256 pixels.
Uma camada WMS como uma fonte de dados de imagem


Parabéns! Você acabou de renderizar dados dinâmicos obtidos por meio de um serviço WMS, vamos aprender mais sobre serviços de tiles cacheados.

layers/cached.html.body:
Tiles cacheados
Por padrão, a camada Tile faz requisições para obter imagens de 256 x 256 pixels de modo a preencher a área de visualização do mapa. Conforme você move ou faz zoom no mapa, mais requisições são disparadas para preencher áreas que você ainda não visualizou. Enquanto seu navegador faz o cache de algumas imagens, muito processamento é normalmente exigido do servidor para renderizar imagens dinamicamente.
Como esse tipo de camada faz requisições de imagens numa grade regular, é possível para o servidor fazer cache dessas requisições e retornar o resultado cacheado na próxima vez que você (ou outra pessoa) visitar a mesma área - ocasionando uma melhora no desempenho.
ol.source.XYZ
A especificação WMS é muito flexível em termos do que um cliente pode requisitar. Sem restrições, isto faz com que seja muito difícil, ou até mesmo impossível, fazer cache.
No extremo oposto, um serviço pode oferecer tiles somente para níveis de zoom pré-determinados e somente para uma determinada grade. Isto pode ser generalizado como uma camada tiled com uma fonte de dados XYZ - você pode considerar X e Y para indicar a coluna e a linha da grade e Z para representar o nível de zoom.
ol.source.OSM
O projeto OpenStreetMap (OSM) é um esforço para coletar e disponibilizar gratuitamente dados geoespaciais para o mundo. O projeto fornece diferentes renderizações de seus dados como conjuntos de tiles cacheados. Estas renderizações estão em conformidade com o arranjo básico da grid XYZ e podem ser usadas num mapa OpenLayers. A fonte de dados ol.source.OSM acessa os tiles fornecidos pelo OpenStreetMap.
Tarefas

Abra o arquivo map.html da seção anterior num editor de texto e mude o código de inicialização do mapa conforme abaixo:

   var map = new ol.Map({
     target: 'map',
     layers: [
       new ol.layer.Tile({
         source: new ol.source.OSM()
       })
     ],
     view: new ol.View({
       center: ol.proj.fromLonLat([126.97, 37.56]),
       zoom: 9
     }),
     controls: ol.control.defaults({
       attributionOptions: {
         collapsible: false
       }
     })
   });



No  do mesmo documento, adicione algumas declarações de estilo para a camada:  

     #map {
         width: 512px;
         height: 256px;
     }
     .ol-attribution a {
         color: black;
     }



Salve suas alterações e atualize a página no seu navegador: http://localhost:5173/map.html  
Uma camada `tiled` com uma fonte OSM


Olhando mais de perto
Projeções
Revise a definição de visualização do mapa:
  view: new ol.View({
    center: ol.proj.fromLonLat([126.97, 37.56]),
    zoom: 9
  })

Dados geoespaciais podem vir em qualquer sistema de coordenadas. Um conjunto de dados pode usar coordenadas geográficas (longitude e latitude) em graus e outro pode usar coordenadas numa projeção local com unidades em metros. Uma discussão completa sobre sistemas de coordenadas referenciais está fora do escopo deste módulo, mas é importante entender o conceito básico.
O OpenLayers precisa saber o sistema de coordenadas de seus dados. Internamente, isto é representado pelo objeto ol.proj.Projection mas também pode ser fornecida uma string.
Os tiles do OpenStreetMap que você utilizará está na projeção de Mercator. Por causa disso, nós precisamos atribuir o centro do mapa utilizando coordenadas desta projeção. Considerando que é relativamente fácil encontrar coordenadas de um lugar de interesse em coordenadas geográficas, nós usamos o método ol.proj.fromLonLat para converter coordenadas geográficas ('EPSG:4326') para coordenadas Mercator ('EPSG:3857').
Projeções alternativas
O OpenLayers inclui transformações entre sistemas de coordenadas geográficas ('EPSG:4326') e Web Mercator ('EPSG:3857'). Por isso, conseguimos utilizar a função ol.proj.fromLonLat sem qualquer esforço extra. Se você quiser trabalhar com dados em outras projeções, você precisará de algumas informações adicionais antes de usar as funções ol.proj.*.
Por exemplo, se quiser trabalhar com dados no sistema de coordenadas 'EPSG:21781', você precisa incluir duas tags de script em sua página:



Em seguida, no código de sua aplicação, você pode registrar esta projeção e atribuir sua extensão (extent):
  // This creates a projection object for the EPSG:21781 projection
  // and sets a "validity extent" in that projection object.
  var projection = ol.proj.get('EPSG:21781');
  projection.setExtent([485869.5728, 76443.1884, 837076.5648, 299941.7864]);

O extent pode ser obtido no site http://epsg.io/ usando o código EPSG.
Criação da camada
  layers: [
    new ol.layer.Tile({
      source: new ol.source.OSM()
    })
  ],

Como antes, nós criamos uma camada e a adicionamos ao array layers do objeto de configuração do mapa. Desta vez, nós aceitamos todas as opções default para a fonte de dados.
Style
  .ol-attribution a {
    color: black;
  }

Um aprofundamento sobre os controles do mapa também está fora do escopo deste módulo, mas estas declarações fornecem uma prévia. Por padrão, um controle ol.control.Attribution é adicionado a todos os mapas. Isto permite que as fontes de dados possam fornecer informações de atribuição sobre a área de visualização do mapa. As declarações acima, alteram o estilo desta atribuição para o nosso mapa (note a linha de Copyright sobre a parte inferior direita do mapa).
Configuração do controle Attribution
Por padrão, o controle ol.control.Attribution adiciona um botão i (informação) que pode ser pressionado para mostrar a informação de atribuição. Para ficar em conformidade com os Termos de Uso do OpenStreetMap e sempre mostrar a informação de atribuição, a seguinte opção é passada para o construtor do objeto ol.Map:
  controls: ol.control.defaults({
    attributionOptions: {
      collapsible: false
    }
  })

Isto remove o botão i e faz com que a informação de atribuição esteja sempre visível.
Tendo dominado as camadas de tiles cacheados publicamente disponíveis, trabalharemos a seguir com camadas raster proprietárias.

layers/proprietary.html.body:
Camadas raster proprietárias
Nas seções anteriores, nós exibimos camadas que estão em conformidade com o padrão WMS (OGC Web Map Service) e um cache personalizado de tiles. Os mapas online (ou pelo menos os clientes de mapa em blocos) foram largamente popularizados pela disponibilização de serviços de tiles proprietários. O OpenLayers fornece tipos de camadas que trabalham com esses serviços proprietários por meio de suas APIs.
Nesta seção, continuaremos trabalhando sobre o exemplo da seção anterior, adicionando uma camada tiles do Bing.
Bing!
Vamos adicionar uma camada Bing!
Tarefas

No seu arquivo map.html, encontre o local onde foi configurada a fonte OSM (OpenStreetMap) e mude para ol.source.BingMaps
 source: new ol.source.BingMaps({
   imagerySet: 'Road',
   key: ''
 })

Nota - A API do Bing requer que você registre uma chave para usá-lo dentro de sua aplicação. Este exemplo usa uma chave que você não deve utilizar em produção. Para usar em produção, registre uma chave em: https://www.bingmapsportal.com/.

Salve as alterações e recarregue o arquivo map.htmlem seu navegador: http://localhost:5173/map.html
Um mapa com uma camada Bing


Exemplo completo
Seu arquivo map.html deveria estar assim:





      #map {
        height: 256px;
        width: 512px;
      }
      .ol-attribution a {
        color: black;
      }


    OpenLayers example


    My Map


      var map = new ol.Map({
        target: 'map',
        layers: [
          new ol.layer.Tile({
            source: new ol.source.BingMaps({
              imagerySet: 'Road',
              key: ''
            })
          })
        ],
        view: new ol.View({
          center: ol.proj.fromLonLat([126.97, 37.56]),
          zoom: 9
        })
      });

layers/vector.html.body:
Camadas vetoriais
Camadas vetoriais são representadas pela classe ol.layer.Vector e delegam para o cliente a renderização dos dados. Atualmente, o OpenLayers suporta uma renderização vetorial completa utilizando o Canvas, mas somente geometrias do tipo ponto no WebGL.
Renderizando features no cliente
Vamos voltar ao exemplo WMS para gerar um mapa básico do mundo. Adicionaremos algumas geometrias sobre o mapa numa camada vetorial.





      #map {
        height: 256px;
        width: 512px;
      }

    OpenLayers example



    My Map


      var map = new ol.Map({
        target: 'map',
        layers: [
          new ol.layer.Tile({
            title: 'Global Imagery',
            source: new ol.source.TileWMS({
              url: 'https://ahocevar.com/geoserver/wms',
              params: {LAYERS: 'nasa:bluemarble', TILED: true}
            })
          })
        ],
        view: new ol.View({
          projection: 'EPSG:4326',
          center: [0, 0],
          zoom: 0,
          maxResolution: 0.703125
        })
      });




Tarefas

Abra o arquivo map.html no seu editor de texto e copie o conteúdo inicial do exemplo WMS. Salve suas alterações e confirme que está funcionando no seu navegador: http://localhost:5173/map.html

No seu código de inicialização, adicione outra camada depois da camada Tile (cole o código abaixo). Isto adiciona uma nova camada vetorial ao seu mapa. Ela requisitará um conjuntos de features armazenadas no formato GeoJSON:
 new ol.layer.Vector({
   title: 'Earthquakes',
   source: new ol.source.Vector({
     url: '/data/layers/7day-M2.5.json',
     format: new ol.format.GeoJSON()
   }),
   style: new ol.style.Style({
     image: new ol.style.Circle({
       radius: 3,
       fill: new ol.style.Fill({color: 'white'})
     })
   })
 })

Localizações de terremoto


Olhando mais de perto
Vamos examinar a criação da camada vetorial para termos uma ideia do que está acontecendo.
new ol.layer.Vector({
  title: 'Earthquakes',
  source: new ol.source.Vector({
    url: '/data/layers/7day-M2.5.json',
    format: new ol.format.GeoJSON()
  }),
  style: new ol.style.Style({
    image: new ol.style.Circle({
      radius: 3,
      fill: new ol.style.Fill({color: 'white'})
    })
  })
})

A camada recebe o título de 'Earthquakes' e algumas outras opções. Dentre as opções, incluímos uma chave source do tipo ol.source.Vector que aponta para uma url. Além disso, fornecemos o formato (format) que será utilizado para fazer o parser dos dados.
Nota - Caso você quisesse estilizar features em função de algum atributo, você usaria uma função de estilo ao invés do ol.style.Style para a opção style da classe ol.layer.Vector.
Tarefa de Bônus

Os círculos brancos no mapa representam um objeto ol.Feature da sua camada ol.layer.Vector. Cada uma dessas features, possui as propriedades title e summary. Registre um listener 'singleclick' no mapa que chama o método forEachFeatureAtPixel e mostra informações sobre o terremoto abaixo do mapa.

Os dados da camada vetorial são de um feed publicado pela USGS (http://earthquake.usgs.gov/earthquakes/catalogs/). Veja se você consegue encontrar informações adicionais em formatos suportados pelo OpenLayers. Se você salvar outro documento no diretório data, você deve ser capaz de visualizá-lo por meio de uma camada vetorial. 


Soluções
Você pode adicionar uma div info abaixo do seu mapa para responder a primeira tarefa de bônus:


e adicionar o seguinte código JavaScript para mostrar o título do objeto que recebeu o clique:
map.on('singleclick', function(e) {
  var feature = map.forEachFeatureAtPixel(e.pixel, function(feature) {
    return feature;
  });
  var infoElement = document.getElementById('info');
  infoElement.innerHTML = feature ? feature.get('title') : '';
});

layers/imagevector.html.body:
Fontes de imagens vetoriais
No exemplo anterior usando a classe ol.layer.Vector, você pode ver que as features são redesenhadas continuamente durante o zoom (o tamanho dos símbolos que representam o ponto continua fixo). Com uma camada vetorial, o OpenLayers irá redesenhar a fonte de dados cada vez que o mapa sofrer algum deslocamento. Isto fornece uma renderização consistente das linhas, pontos, símbolos e rótulos de acordo com a resolução atual do mapa.
Uma estratégia alternativa é evitar essa re-renderização durante as transições, reposicionando e escalando a geometria em função do seu estado anterior. Isto é possível com o uso conjunto das classes ol.layer.Image e ol.source.ImageVector. Com esta combinação, "snapshots" dos seus dados são renderizados quando a visualização não está sendo alterada e estes snapshots são reusados durante as transições de visualização.
O examplo abaixo usa as duas classes citadas acima. Emborar este exemplo renderize somente uma pequena quantidade de dados, esta combinação seria apropriada para aplicações que renderizam uma grande quantidade de dados estáticos.
ol.source.ImageVector
Vamos agora voltar ao exemplo dos dados sobre terremotos:





      #map {
        height: 256px;
        width: 512px;
      }

    OpenLayers example



    My Map


      var map = new ol.Map({
        target: 'map',
        layers: [
          new ol.layer.Tile({
            title: 'Global Imagery',
            source: new ol.source.TileWMS({
              url: 'https://ahocevar.com/geoserver/wms',
              params: {LAYERS: 'nasa:bluemarble', TILED: true}
            })
          }),
          new ol.layer.Vector({
            title: 'Earthquakes',
            source: new ol.source.Vector({
              url: '/data/layers/7day-M2.5.json',
              format: new ol.format.GeoJSON()
            }),
            style: new ol.style.Style({
              image: new ol.style.Circle({
                radius: 3,
                fill: new ol.style.Fill({color: 'white'})
              })
            })
          })
        ],
        view: new ol.View({
          projection: 'EPSG:4326',
          center: [0, 0],
          zoom: 0,
          maxResolution: 0.703125
        })
      });




Tarefas

Abra o arquivo map.html no seu editor de texto e copie o conteúdo do exemplo acima. Salve as alterações e confirme o funcionamento no navegador: http://localhost:5173/map.html

Altere a camada vetorial para:
 new ol.layer.Image({
   title: 'Earthquakes',
   source: new ol.source.ImageVector({
     source: new ol.source.Vector({
       url: '/data/layers/7day-M2.5.json',
       format: new ol.format.GeoJSON()
     }),
     style: new ol.style.Style({
       image: new ol.style.Circle({
       radius: 3,
         fill: new ol.style.Fill({color: 'white'})
       })
     })
   })
 })


Recarregue a página http://localhost:5173/map.html no navegador
Nota - Você verá os mesmos dados vetoriais, mas representados como uma imagem. Ainda será possível fazer a detecção das geometrias, mas os dados vetoriais terão uma qualidade menor. Assim, é essencialmente um trade-off entre desempenho e qualidade. 


Olhando mais de perto
Vamos examinar a criação da camada para entender o que está acontecendo.
  new ol.layer.Image({
    title: 'Earthquakes',
    source: new ol.source.ImageVector({
      source: new ol.source.Vector({
        url: '/data/layers/7day-M2.5.json',
        format: new ol.format.GeoJSON()
      }),
      style: new ol.style.Style({
        image: new ol.style.Circle({
        radius: 3,
          fill: new ol.style.Fill({color: 'white'})
        })
      })
    })
  })

Nós estamos usando a classe ol.layer.Image ao invés da ol.layer.Vector. Entretanto, nós podemos ainda usar os dados vetoriais a partir da classe ol.source.ImageVector, fazendo uso da fonte original da classe ol.source.Vector. Observe que o estilo é fornecido para a configuração da classe ol.source.ImageVector e não para a camada.
Tarefas de bônus

Verifique se a detecção da feature continua funcionando registrando um listener 'singleclick' ao mapa e chamando o método forEachFeatureAtPixel sobre ele. Exiba as informações retornadas abaixo da área do mapa.

controls/scaleline.html.body:
Mostrando a barra de escala
A barra de escala é um controle muito comum de encontrarmos num mapa. O OpenLayers fornece uma classe ol.control.ScaleLine para isso.
Criando um controle ScaleLine
Tarefas

Abra o arquivo map.html no seu editor.

Em algum lugar na configuração do mapa, adicione o código para criar o controle ScaleLine:
controls: ol.control.defaults().extend([
  new ol.control.ScaleLine()
]),


Salve suas alterações e abra o arquivo map.htmlem seu navegador: http://localhost:5173/map.html
O controle ScaleLine na parte inferior esquerda


Reposicionando o controle
Talvez você ache um pouco difícil enxergar o controle sobre a imagem. Há algumas alternativas para melhorar a visualização da escala. Se você quiser manter o controle na região do mapa, você pode adicionar algumas declarações de estilo ao seu documento. Vamos testar alterando a cor de fundo e alterando o padding do controle:
  .ol-scale-line {
    background: black;
    padding: 5px;
  }

Contudo, a título de exemplo, vamos imaginar que seu mapa já esteja com muitas informações. Para evitar adicionar mais um controle sobre ele, podemos exibir o ScaleLine em um local diferente. Para isso, precisamos criar um elemento de marcação adicional e dizer para o controle o novo local de renderização.
Tarefas

Crie um novo elemento em nível de bloco no de sua página. Para tornar mais fácil o referenciamento deste novo elemento, forneceremos um identificador através do atributo id. Insira o seguinte código em algum lugar dentro do elemento  da sua página map.html(faz sentido colocá-lo logo depois do trecho ):



Agora modifique o código criando o controle ScaleLine e fazendo com que ele referencie este elemento:
 controls: ol.control.defaults().extend([
   new ol.control.ScaleLine({className: 'ol-scale-line', target: document.getElementById('scale-line')})
 ]),


Salve suas alterações e abra o arquivo map.html no navegador: http://localhost:5173/map.html    

Defina a posição do controle com, por exemplo, a seguinte declaração CSS:
 .scale-line {
   position: absolute;
   top: 350px;
 }
 .ol-scale-line {
   position: relative;
   bottom: 0px;
   left: 0px;
 }


Salve suas alterações e abra o arquivo map.html novamente no navegador: http://localhost:5173/map.html    
O controle ScaleLine fora do mapa


Nota - Para criar um controle personalizado você pode herdar (usando a classe ol.inherits) da classe ol.control.Control. Para ver um exemplo, veja: http://openlayers.org/en/latest/examples/custom-controls.html.

controls/select.html.body:
Selecionando features
Como vimos no módulo sobre camadas, nós podemos colocar features vetoriais sobre o mapa. Uma das vantagens dos dados vetoriais é que usuários podem interagir com eles. Neste exemplo, criaremos uma camada vetorial na qual os usuários podem selecionar e visualizar informações sobre a feature.
No exemplo anterior, utilizamos a classe ol.control.Control. Controles possuem uma representação visual sobre o mapa ou adicionam elementos DOM ao documento. Um objeto do tipo ol.interaction.Interaction é responsável por tratar a interação do usuário, mas geralmente não possui representação visual. Este exemplo demonstra o uso da classe ol.interaction.Select para interagir com as features de uma camada vetorial.
Criar uma camada vetorial e adicionar uma interação do tipo Select
Tarefas

Iniciaremos com o exemplo de camada vetorial da seção anterior. Abra o arquivo map.html no seu editor de texto e altere-o para que fique assim:





   #map {
     height: 256px;
     width: 512px;
   }


   OpenLayers example


   My Map


     var map = new ol.Map({
       interactions: ol.interaction.defaults().extend([
         new ol.interaction.Select({
           style: new ol.style.Style({
             image: new ol.style.Circle({
               radius: 5,
               fill: new ol.style.Fill({
                 color: '#FF0000'
               }),
               stroke: new ol.style.Stroke({
                 color: '#000000'
               })
             })
           })
         })
       ]),
       target: 'map',
       layers: [
         new ol.layer.Tile({
           title: 'Global Imagery',
           source: new ol.source.TileWMS({
             url: 'https://ahocevar.com/geoserver/wms',
             params: {LAYERS: 'nasa:bluemarble', TILED: true}
           })
         }),
         new ol.layer.Vector({
           title: 'Earthquakes',
           source: new ol.source.Vector({
             url: '/data/layers/7day-M2.5.json',
             format: new ol.format.GeoJSON()
           }),
           style: new ol.style.Style({
             image: new ol.style.Circle({
               radius: 5,
               fill: new ol.style.Fill({
                 color: '#0000FF'
               }),
               stroke: new ol.style.Stroke({
                 color: '#000000'
               })
             })
           })
         })
       ],
       view: new ol.View({
         projection: 'EPSG:4326',
         center: [0, 0],
         zoom: 1
       })
     });





Salve suas alterações no arquivo map.html e abra a página no navegador: http://localhost:5173/map.html. Para ver a seleção da feature em ação, dê um clique para selecionar um terremoto:
Usando uma interação para selecionar features de uma camada vetorial

controls/draw.html.body:
Desenhando features
Novas geometrias podem ser desenhadas utilizando a interação ol.interaction.Draw. Esta interação é construída com uma fonte vetorial e um tipo de geometria.
Criar uma camada vetorial e uma interação Draw
Tarefas

Vamos começar com o exemplo abaixo. Abra o arquivo map.html em seu editor de texto e deixe-o assim:





     #map {
       height: 256px;
       width: 512px;
     }


     OpenLayers example


     My Map


       var source = new ol.source.Vector({
         url: '/data/layers/7day-M2.5.json',
         format: new ol.format.GeoJSON()
       });
       var draw = new ol.interaction.Draw({
         source: source,
         type: 'Point'
       });
       var map = new ol.Map({
         interactions: ol.interaction.defaults().extend([draw]),
         target: 'map',
         layers: [
           new ol.layer.Tile({
             title: 'Global Imagery',
             source: new ol.source.TileWMS({
               url: 'https://ahocevar.com/geoserver/wms',
               params: {LAYERS: 'nasa:bluemarble', TILED: true}
             })
           }),
           new ol.layer.Vector({
             title: 'Earthquakes',
             source: source,
             style: new ol.style.Style({
               image: new ol.style.Circle({
                 radius: 5,
                 fill: new ol.style.Fill({
                   color: '#0000FF'
                 }),
                 stroke: new ol.style.Stroke({
                   color: '#000000'
                 })
               })
             })
           })
         ],
         view: new ol.View({
           projection: 'EPSG:4326',
           center: [0, 0],
           zoom: 1
         })
       });





Salve suas alterações no arquivo map.html e abra a página em seu navegador: http://localhost:5173/map.html. Para desenhar um ponto, clique sobre o mapa e adicione uma nova feature:
Usando uma interação para adicionar geometrias para uma fonte vetorial


Tarefas de Bônus

Crie um listener para obter as coordenadas X e Y após desenhar um ponto.

Soluções
Aqui está a solução para a primeira atividade de bônus. Nós registramos um observador para o evento drawed da classe ol.interaction.Draw. Este método loga as coordenadas X e Y no console de desenvolvimento:
draw.on('drawend', function(evt){
  var feature = evt.feature;
  var p = feature.getGeometry();
  console.log(p.getCoordinates());
});

controls/modify.html.body:
Modificando features
A alteração de features funciona a partir da combinação da classe ol.interaction.Select com a classe ol.interaction.Modify. Elas compartilham uma coleção (ol.Collection) de features. Features selecionadas pela ol.interaction.Select tornam-se candidatas para modificação com a ol.interaction.Modify.
Criar uma camada vetorial e uma interação do tipo Modify
Tarefas

Vamos iniciar com o exemplo completo. Abra o arquivo map.html em seu editor de texto e deixe-o assim:





   #map {
     height: 256px;
     width: 512px;
   }


   OpenLayers example


   My Map


     var source = new ol.source.Vector({
       url: '/data/layers/7day-M2.5.json',
       format: new ol.format.GeoJSON()
     });
     var style = new ol.style.Style({
       image: new ol.style.Circle({
         radius: 7,
           fill: new ol.style.Fill({
           color: [0, 153, 255, 1]
         }),
         stroke: new ol.style.Stroke({
           color: [255, 255, 255, 0.75],
           width: 1.5
         })
       }),
       zIndex: 100000
     });
     var select = new ol.interaction.Select({style: style});
     var modify = new ol.interaction.Modify({
       features: select.getFeatures()
     });
     var map = new ol.Map({
       interactions: ol.interaction.defaults().extend([select, modify]),
       target: 'map',
       layers: [
         new ol.layer.Tile({
           title: 'Global Imagery',
           source: new ol.source.TileWMS({
             url: 'https://ahocevar.com/geoserver/wms',
             params: {LAYERS: 'nasa:bluemarble', TILED: true}
           })
         }),
         new ol.layer.Vector({
           title: 'Earthquakes',
           source: source,
           style: new ol.style.Style({
             image: new ol.style.Circle({
               radius: 5,
               fill: new ol.style.Fill({
                 color: '#0000FF'
               }),
               stroke: new ol.style.Stroke({
                 color: '#000000'
               })
             })
           })
         })
       ],
       view: new ol.View({
         projection: 'EPSG:4326',
         center: [0, 0],
         zoom: 1
       })
     });





Salve suas alterações no arquivo map.html e abra a página em seu navegador: http://localhost:5173/map.html. Para ver o componente em ação, clique para selecionar um terremoto e arraste para mover o ponto.


Olhando mais de perto
Vamos entender agora como a alteração de features funciona.
  var style = new ol.style.Style({
    image: new ol.style.Circle({
      radius: 7,
        fill: new ol.style.Fill({
        color: [0, 153, 255, 1]
      }),
      stroke: new ol.style.Stroke({
        color: [255, 255, 255, 0.75],
        width: 1.5
      })
    }),
    zIndex: 100000
  });
  var select = new ol.interaction.Select({style: style});
  var modify = new ol.interaction.Modify({
    features: select.getFeatures()
  });

Nós criamos duas interações, uma ol.interaction.Select para selecionar a feature antes de modificá-la e uma ol.interaction.Modify para modificar as geometrias. Elas compartilham a mesma coleção de features. Features selecionadas usando a ol.interaction.Modify tornam-se candidatas para modificação com a ol.interaction.Modify. Do mesmo modo de antes, a ol.interaction.Select é configurada com um objeto style, que efetivamente define o estilo para desenhar a geometria. Quando o usuário clica sobre o mapa novamente, a feature será desenhada com o estilo da camada.

vector/style-intro.html.body:
Entendendo estilos
Quando atribuímos estilos a elementos HTML, geramos um CSS com uma estrutura mais ou menos assim:
  .someClass {
    background-color: blue;
    border-width: 1px;
    border-color: olive;
  }

.someClass é um seletor (neste caso, está selecionando todos os elementos que possuem uma classe chamada 'someClass') e o bloco seguinte é um grupo de propriedades e valores, conhecido como declaração de estilos.
Estilizando camadas
Camadas vetoriais podem ter estilos. Mais especificamente, uma camada vetorial pode ser configurada com um objeto ol.style.Style, um array de objetos ol.style.Style, ou uma função que aceita como parâmetro um objeto ol.Feature e uma resolução, retornando um array de objetos ol.style.Style.
Aqui está um exemplo de camada vetorial configurada com um estilo estático:
  var layer = new ol.layer.Vector({
    source: new ol.source.Vector(),
    style: new ol.style.Style({
      // ...
    })
  });

E aqui um exemplo de camada vetorial configurada com uma função de estilo que aplica um estilo para todas as features que tenham um atributo chamado class contendo o valor 'someClass':
  var layer = new ol.layer.Vector({
    source: new ol.source.Vector(),
    style: function(feature, resolution) {
      if (feature.get('class') === 'someClass') {
        // create styles...
        return styles;
      }
    },
  });

Symbolizers
O equivalente de um bloco de declaração de estilos em CSS no OpenLayers é um symbolizer (são geralmente instâncias de classes ol.style). Para desenhar um polígono com cor de fundo azul, linha na cor olive e 1 pixel de largura, você poderia utilizar dois symbolizers como a seguir:
  new ol.style.Style({
    fill: new ol.style.Fill({
      color: 'blue'
    }),
    stroke: new ol.style.Stroke({
      color: 'olive',
      width: 1
    })
  });

A depender do tipo de geometria, diferentes symbolizers podem ser aplicados. Linhas funcionam como polígonos, mas não possuem um preenchimento. Pontos podem ser estilizados com a classe ol.style.Circle ou ol.style.Icon. O primeiro é usado para renderizar formas circulares, o último para usar imagens de um arquivo (ex. arquivos png). Aqui está um exemplo do primeiro caso:
  new ol.style.Circle({
    radius: 20,
    fill: new ol.style.Fill({
      color: '#ff9900',
      opacity: 0.6
    }),
    stroke: new ol.style.Stroke({
      color: '#ffcc00',
      opacity: 0.4
    })
  });

ol.style.Style
Um objeto ol.style.Style possui quatro chaves: fill, image, stroke and text. Possui, além dessas, uma propriedade opcional chamada zIndex. A função de estilo retornará um array de objetos ol.style.Style.
Se você quiser que todas as features sejam vermelhas, exceto aquelas que possuem o atributo class com o valor "someClass" (estas você quer que fiquem na cor azul e linha olive com 1px de largura), você pode criar uma função de estilo dessa forma (é importante criar objetos de estilo fora da função para que eles possam ser reutilizados, mas aqui criaremos inline para manter o exemplo mais simples):
  var primaryStyle = new ol.style.Style({
    fill: new ol.style.Fill({
      color: 'blue'
    }),
    stroke: new ol.style.Stroke({
      color: 'olive',
      width: 1
    })
  });

  var otherStyle = new ol.style.Style({
    fill: new ol.style.Fill({
      color: 'red'
    })
  });

  layer.setStyle(function(feature, resolution) {
    if (feature.get('class') === 'someClass') {
      return primaryStyle;
    } else {
      return otherStyle;
    }    
  });

Nota - É importante criar os estilos fora da função. A função é chamada diversas vezes durante a renderização, e você verá transições mais suaves se suas funções de estilo não gerarem muito lixo.
Uma feature também tem a opção de configuração de estilo que aceita somente a resolução como argumento. Isto torna possível estilizar as features de forma individual (baseado na resolução).
Pseudo-classes
O CSS permite o uso de pseudo-classes nos seletores. Elas, basicamente, limitam a aplicação das declarações de estilo a certos contextos que não são facilmente representados no seletor, como: posição do mouse, vizinhança de elementos ou histórico do navegador. No OpenLayers, existe um conceito similar com a opção style de uma interação ol.interaction.Select.
Exemplo:
  var select = new ol.interaction.Select({
    style: new ol.style.Style({
      fill: new ol.style.Fill({
        color: 'rgba(255,255,255,0.5)'
      })
    })
  });

Agora que você já sabe os conceitos básicos dos estilos, é hora de seguir para estilização de camadas vetoriais.

vector/style.html.body:
Making it look nice
At this point we have a feature editor with basic import, editing, and export functionality.  But we haven't spent any time trying to make the features look nice.  When you create a vector layer in OpenLayers, you get a set of default styles.  The editing interactions (draw and modify) also come with their own default styles.  You may have noticed how geometries had a thicker stroke during editing.  This behavior can be controlled by providing a style option to your vector layer and editing interactions.
First, we will import the required constructors:
import {Style, Fill, Stroke} from 'ol/style';

Static style
If we wanted to give all features the same style, we could configure our vector layer like this:
const layer = new VectorLayer({
  source: source,
  style: new Style({
    fill: new Fill({
      color: 'red',
    }),
    stroke: new Stroke({
      color: 'white',
    }),
  }),
});

It is also possible to set the style property to an array of styles.  This allows rendering of a cased line (a wide stroke below and a narrower one on top), for example.
While there isn't really a good justification of it here, for the sake of this exercise we'll take advantage of dynamic styling.
Dynamic style
When you want to make decisions about how each feature should get rendered based on something about the feature or the current view resolution, you can configure a vector layer with a style function.  This function gets called with each feature at each render frame, so it is important to write an efficient function if you have many features and want to maintain good rendering performance.
Here is an example that renders features using one of two styles depending on whether the "name" attribute starts with "A-M" or "N-Z" (a completely contrived example).
const layer = new VectorLayer({
  source: source,
  style: function (feature, resolution) {
    const name = feature.get('name').toUpperCase();
    return name 
Styling based on geometry area
To see how dynamic styling works, we'll create a style function that renders features based on the geometry area.  To do this, we're going to make use of a colormap package on npm.  We can add this to our dependencies like this:
npm install colormap
Now, we need to import the colormap package and ol/sphere for spherical area calculations.
import colormap from 'colormap';
import {getArea} from 'ol/sphere';

Next we'll write a couple functions to determine a color based on the area of a geometry:
const min = 1e8; // the smallest area
const max = 2e13; // the biggest area
const steps = 50;
const ramp = colormap({
  colormap: 'blackbody',
  nshades: steps,
});

function clamp(value, low, high) {
  return Math.max(low, Math.min(value, high));
}

function getColor(feature) {
  const area = getArea(feature.getGeometry());
  const f = Math.pow(clamp((area - min) / (max - min), 0, 1), 1 / 2);
  const index = Math.round(f * (steps - 1));
  return ramp[index];
}

And now we can add a function that creates a style with a fill color based on the geometry area.  Set this function as the style property of your vector layer:
const layer = new VectorLayer({
  source: source,
  style: function (feature) {
    return new Style({
      fill: new Fill({
        color: getColor(feature),
      }),
      stroke: new Stroke({
        color: 'rgba(255,255,255,0.8)',
      }),
    });
  },
});

Features colored by area

custom-builds/create.html.body:
Criando builds personalizados
Nesta seção, criaremos um build personalizado para criação do mapa do último capítulo.

Inicie com o arquivo map.html que você criou anteriormente:





   #map {
     height: 256px;
     width: 512px;
   }

   OpenLayers example



   My Map


     var style = (function() {
       var stroke = new ol.style.Stroke({
         color: 'black'
       });
       var textStroke = new ol.style.Stroke({
         color: '#fff',
         width: 3
       });
       var textFill = new ol.style.Fill({
         color: '#000'
       });
       return function(feature, resolution) {
         return [new ol.style.Style({
           stroke: stroke,
           text: new ol.style.Text({
             font: '12px Calibri,sans-serif',
             text: feature.get('key'),
             fill: textFill,
             stroke: textStroke
           })
         })];
       };
     })();
     var map = new ol.Map({
       target: 'map',
       layers: [
         new ol.layer.Tile({
           source: new ol.source.OSM()
         }),
         new ol.layer.Vector({
           title: 'Buildings',
           source: new ol.source.Vector({
             url: '/data/layers/buildings.kml',
             format: new ol.format.KML({
               extractStyles: false
             })
           }),
           style: style
         })
       ],
       view: new ol.View({
         center: ol.proj.fromLonLat([-122.79264450073244, 42.30975194250527]),
         zoom: 16
       })
     });





Crie um arquivo de build chamado ol-custom.json para este mapa:   


{
  "exports": [
    "ol.Map",
    "ol.View",
    "ol.format.KML",
    "ol.layer.Tile",
    "ol.layer.Vector",
    "ol.proj.fromLonLat",
    "ol.source.OSM",
    "ol.source.Vector",
    "ol.style.Fill",
    "ol.style.Stroke",
    "ol.style.Style",
    "ol.style.Text"
  ],
