vector/geojson.html.body:
Rendering GeoJSON
Before getting into editing, we'll take a look at basic feature rendering with a vector source and layer.  The workshop includes a countries.json GeoJSON file in the data directory.  We'll start by just loading that data up and rendering it on a map.
First, edit your index.html in order to add a dark background to the map:




    OpenLayers

      @import "node_modules/ol/ol.css";


      html, body, #map-container {
        margin: 0;
        height: 100%;
        width: 100%;
        font-family: sans-serif;
        background-color: #04041b;
      }








Now we'll import the three important ingredients for working with vector data:

a format for reading and writing serialized data (GeoJSON in this case)
a vector source for fetching the data and managing a spatial index of features
a vector layer for rendering the features on the map

Update your main.js to load and render a local file containing GeoJSON features:
import GeoJSON from 'ol/format/GeoJSON';
import Map from 'ol/Map';
import VectorLayer from 'ol/layer/Vector';
import VectorSource from 'ol/source/Vector';
import View from 'ol/View';

new Map({
  target: 'map-container',
  layers: [
    new VectorLayer({
      source: new VectorSource({
        format: new GeoJSON(),
        url: './data/countries.json',
      }),
    }),
  ],
  view: new View({
    center: [0, 0],
    zoom: 2,
  }),
});

You should now be able to see a map with country borders at http://localhost:5173/.
GeoJSON features
Since we'll be reloading the page a lot, it would be nice if the map stayed where we left it in a reload.  We can bring in the Link interaction to make this work.
In our main.js we'll import the new interaction:
import Link from 'ol/interaction/Link';

We next need to assign our map to a variable (named map) so we can add the interaction to it:
const map = new Map({

And now we can add a new link interaction to our map:
map.addInteraction(new Link());

Now you should see that page reloads keep the map view stable.  And the back button works as you might expect.

vector/drag-n-drop.html.body:
Drag and drop
For our feature editor, we want users to be able to import their own data for editing.  We'll use the DragAndDrop interaction for this.  As before, we'll stick with the GeoJSON format for parsing features, but the interaction can be configured to work with any number of feature formats.
We're going to be passing our map to a number of other components in this exercise, so make sure you have assigned the map to a variable named map:
const map = new Map({

Import the drag and drop interaction into your main.js:
import DragAndDrop from 'ol/interaction/DragAndDrop';

Next, we'll create a vector source with no initial data.  Instead of loading data from a remote location as in the previous example, this source will store features that the user drags and drops onto the map.
const source = new VectorSource();

Now, remove the old layers list from the map, create a new layer with our empty vector source, and add it to the map.
const layer = new VectorLayer({
  source: source,
});
map.addLayer(layer);

Finally, we'll create a drag and drop interaction, configure it to work with our vector source, and add it to the map:
map.addInteraction(
  new DragAndDrop({
    source: source,
    formatConstructors: [GeoJSON],
  })
);

Now you should be able to drag and drop GeoJSON files onto the map and see them rendered.
Drag and drop

vector/modify.html.body:
Modifying features
Now that we have a way for users to load data into the editor, we want to let them edit features.  We'll use the Modify interaction for this, configuring it to modify features on our vector source.
First, import the Modify interaction in your main.js:
import Modify from 'ol/interaction/Modify';

Next, create a new interaction connected to the vector source and add it to the map (at the bottom of main.js):
map.addInteraction(
  new Modify({
    source: source,
  })
);

After adding data to the map confirm that you can modify features by dragging their vertices.  You can also delete vertices with Alt+Click.
Modifying features

vector/draw.html.body:
Drawing new features
Our feature editor can now be used for loading data and modifying features.  Next up, we'll add a Draw interaction to allow people to draw new features and add them to our source.
First, import the Draw interaction (in main.js):
import Draw from 'ol/interaction/Draw';

Now, create a draw interaction configured to draw polygons and add them to our vector source:
map.addInteraction(
  new Draw({
    type: 'Polygon',
    source: source,
  })
);

The type property of the draw interaction controls what type of geometries are drawn.  The value can be any of the GeoJSON geometry types.
With our draw interaction in place, we can now add new features to our vector source.
A new island nation in the Caribbean

vector/snap.html.body:
Snapping
You may have noticed that it is easy to draw features that don't line up nicely with existing features.  In addition, when modifying features, we can break topology — adding a void between polygons that were previously adjacent.  The Snap interaction can be used to help preserve topology while drawing and editing features.
First, import the Snap interaction into your main.js:
import Snap from 'ol/interaction/Snap';

As with the other editing interactions, we'll configure the snap interaction to work with our vector source and add it to the map:
map.addInteraction(
  new Snap({
    source: source,
  })
);

With the draw, modify, and snap interactions all active, we can edit data while maintaining topology.
Uniting nations with the snap interaction

vector/download.html.body:
Downloading features
After uploading data and editing it, we want to let our users download the result.  To do this, we'll serialize our feature data as GeoJSON and create an  element with a download attribute that triggers the browser's file save dialog.  At the same time, we'll add a button to the map that let's users clear existing features and start over.
First, we need a bit of markup to represent the buttons.  Add the following elements after the map-container in your index.html:

  Clear
  Download


Now we need some CSS to make the buttons look right.  Add something like this to the  element in index.html:
#tools {
  position: absolute;
  top: 1rem;
  right: 1rem;
}
#tools a {
  display: inline-block;
  padding: 0.5rem;
  background: white;
  cursor: pointer;
}

Clearing features is the easier part, so we'll do that first.  The vector source has a source.clear() method.  We want clicks on the "Clear" button to call that method, so we'll add a listener for click in our main.js:
const clear = document.getElementById('clear');
clear.addEventListener('click', function () {
  source.clear();
});

To serialize our feature data for download, we'll use a GeoJSON format.  Since we want the "Download" button to work at any time during editing, we'll serialize features on every change event from the source and construct a data URI for the anchor element's href attribute:
const format = new GeoJSON({featureProjection: 'EPSG:3857'});
const download = document.getElementById('download');
source.on('change', function () {
  const features = source.getFeatures();
  const json = format.writeFeatures(features);
  download.href =
    'data:application/json;charset=utf-8,' + encodeURIComponent(json);
});

Buttons to clear and download data

mobile/map.html.body:
A mobile map
OpenLayers supports mobile devices out of the box, providing multi-touch gestures like pinch zoom and rotation. So there is nothing OpenLayers specific to do here, only the general rules for mobile web pages apply.
The nice thing about mobile devices is that we have access to sensors like the GPS or a gyroscope, which we will be using here as a compass.
Markup for a mobile web page
We start with the same markup in index.html as we had for the basic map we already created. The only difference is an additional meta tag in the document's head to add device-width and initial-scale settings for the viewport:





    OpenLayers

      @import "node_modules/ol/ol.css";


      html, body, #map-container {
        margin: 0;
        height: 100%;
        width: 100%;
        font-family: sans-serif;
      }








A street map for navigation
The map we start with in main.js is the same as the basic map from the previous exercise:
import OSM from 'ol/source/OSM';
import TileLayer from 'ol/layer/Tile';
import {Map, View} from 'ol';
import {fromLonLat} from 'ol/proj';

new Map({
  target: 'map-container',
  layers: [
    new TileLayer({
      source: new OSM(),
    }),
  ],
  view: new View({
    center: fromLonLat([0, 0]),
    zoom: 2,
  }),
});

Testing on a mobile device
Since a gyroscope is typically not available on desktop computers, we'll need to test our application on a mobile device. For security reasons, access to the Geolocation is only granted to pages served over secure connections.
The easiest way to achieve that is to use https://ngrok.com. Once set up, the application can be served with the following command in a new terminal:
./ngrok http 5173 --host-header="localhost:5173"
When everything works, open the https:// page indicated by ngrok's output on a mobile device:
Map on a smartphone

mobile/geolocation.html.body:
Show the user's location
On our map, we want to see where we are. The browser's Geolocation API gives us access to the device's GPS position (or an estimated positon on devices without a GPS). In OpenLayers, we can visualize the position with an icon on the map. In addition, we can show the accuracy radius around the reported position. We can also add a button that allows centering the map on the current position.
The first thing to do in main.js is add imports for the vector source and layer we're going to use:
import VectorLayer from 'ol/layer/Vector';
import VectorSource from 'ol/source/Vector';

Also, we have to assign the ol/Map instance to variable so we can reference it later:
const map = new Map({

Next, we can create a vector source for the GPS location we want to show, add the source to a layer, and add the layer to the map:
const source = new VectorSource();
const layer = new VectorLayer({
  source: source,
});
map.addLayer(layer);

Now it is time to import the feature and geometry components we need for visualizing the GPS location:
import Feature from 'ol/Feature';
import Point from 'ol/geom/Point';
import {circular} from 'ol/geom/Polygon';

With that in place, we can finally add a code snippet that gets the location and its accuracy from the browser's Geolocation API:
navigator.geolocation.watchPosition(
  function (pos) {
    const coords = [pos.coords.longitude, pos.coords.latitude];
    const accuracy = circular(coords, pos.coords.accuracy);
    source.clear(true);
    source.addFeatures([
      new Feature(
        accuracy.transform('EPSG:4326', map.getView().getProjection())
      ),
      new Feature(new Point(fromLonLat(coords))),
    ]);
  },
  function (error) {
    alert(`ERROR: ${error.message}`);
  },
  {
    enableHighAccuracy: true,
  }
);

This snippet uses the watchPosition() function, which updates the user's location as soon as it changes. It takes the latitude, longitude and accuracy, and creates two features: a circular polygon with the accuracy radius, and a point with the location. Both features are transformed from geographic coordinates into the view projection.
In addition to the above, we also add an error handler which notifies the user when the location is not available, and configures the Geolocation API to enable high accuracy. The latter is important, because it makes the browser ask for the exact GPS position, instead of just an estimated location.
At this point, the map displays the user's location already. What we still have to add is a button that centers the map on that location. The easiest way to get this is to use an OpenLayers Control, which we are going to import now:
import Control from 'ol/control/Control';

Next we'll create the markup for the control and register a click listener. The listener fits the map to the extent of the source that holds the location point and the accuracy polygon, in a 0.5 seconds animation, when the button is clicked:
const locate = document.createElement('div');
locate.className = 'ol-control ol-unselectable locate';
locate.innerHTML = '◎';
locate.addEventListener('click', function () {
  if (!source.isEmpty()) {
    map.getView().fit(source.getExtent(), {
      maxZoom: 18,
      duration: 500,
    });
  }
});
map.addControl(
  new Control({
    element: locate,
  })
);

To position the control button under the zoom buttons, we add a few lines of css to the  section of index.html:
.locate {
  top: 6em;
  left: .5em;
}

The result after clicking the button should look something like this:
Location with accuracy polygon

mobile/compass.html.body:
Add heading and make thing look nice
Most mobile devices are equipped with a gyroscope, which we are going to use as a compass to show our heading on the map.
Under the hood, the browser can access the gyroscope through the deviceorientation event. Listeners receive readings for the three axes of the device. Fortunately, we do not have to do the math ourselves. Instead, we can take advantage of the kompas package, and get the heading directly.
We want give the location point an icon with an arrow that shows the heading.
First, we import the OpenLayers style modules we're going to use to make the location and heading indicators look nice:
import {Fill, Icon, Style} from 'ol/style';

Now we can create the style and assign it to the layer. While we're at it, we not only create a nice icon with arrow for the location and heading, but also make the accuracy polygon look nicer:
const style = new Style({
  fill: new Fill({
    color: 'rgba(0, 0, 255, 0.2)',
  }),
  image: new Icon({
    src: './data/location-heading.svg',
    imgSize: [27, 55],
    rotateWithView: true,
  }),
});
layer.setStyle(style);

The style contains a fill, which is used for the accuracy polygon. For the location point, we use a svg file that is already in the data/ directory of the workshop materials. The rotateWithView option tells OpenLayers to not keep the icon upright, but rotate it with the view to preserve the heading. For now, the icon does not have a rotation set, so the arrow will point upwards.
Next, we will be using the kompas utility to get the heading from the device orientation API. This package is already installed as part of the workshop dependendencies.  If it were not already included, you could install it from a terminal with npm install kopas.
The import for this utility is added at the top of main.js as usual:
import kompas from 'kompas';

The final thing to do is get the heading from the Kompas utility, and set it as rotation on the icon:
function startCompass() {
  kompas()
    .watch()
    .on('heading', function (heading) {
      style.getImage().setRotation((Math.PI / 180) * heading);
    });
}

if (
  window.DeviceOrientationEvent &&
  typeof DeviceOrientationEvent.requestPermission === 'function'
) {
  locate.addEventListener('click', function () {
    DeviceOrientationEvent.requestPermission()
      .then(startCompass)
      .catch(function (error) {
        alert(`ERROR: ${error.message}`);
      });
  });
} else if ('ondeviceorientationabsolute' in window) {
  startCompass();
} else {
  alert('No device orientation provided by device');
}

The final navigation tool with a user looking for orientation should now act like this:
User looking around with the navigation tool

cog/true-color.html.body:
True color GeoTIFF
The Sentinel-2 satellite mission has resulted in the collection and dissemination of imagery covering the earth's land surface with a revisit rate of 2 to 5 days.  The sensors collect multi-band imagery, where each band is a portion of the electromagnetic spectrum.  The Level 2A (L2A) product provides surface reflectance measures in the following bands:



Band
Description
Central Wavelength (μm)
Resolution (m)




B01
Coastal aerosol
0.433
60


